My Vodafone Business è l’applicazione gratuita Vodafone completamente rinnovata e dedicata a tutti i clienti Business. Con My Vodafone Business puoi tenere sempre sotto controllo la tua spesa, il traffico effettuato e le offerte attive, trovare il punto assistenza Vodafone più vicino a te e conoscere le offerte a te dedicate. 

Se sei un cliente Business, potrai accedere alle seguenti funzionalità:
• Happy Business: con Vodafone sorridi ogni venerdi. Ricevi i regali che abbiamo pensato per i nostri clienti business;
• Contatori: visualizza tutti i contatori delle offerte attive. Se sei il referente aziendale, puoi verificare il dettaglio di ogni SIM del tuo parco aziendale;
• Fatture: visualizza lo storico delle fatture o invia via mail una copia in formato pdf. Accedi, inoltre, a Fattura Facile per inserire o modificare i dati della tua azienda per la fatturazione elettronica;
• Offerte attive: visualizza le offerte attive. Se sei il referente aziendale, puoi verificare il dettaglio di ogni SIM del tuo parco aziendale;
• Nuove offerte: scopri e attiva le offerte che abbiamo pensato per te. Se sei il referente aziendale, puoi visualizzare e attivare le offerte anche per le SIM del tuo parco aziendale;
• Rete garantita: effettua uno speed test e, se sei un referente aziendale, monitora le performance di rete delle tue SIM;
• Estero: visualizza le informazioni relative alle tariffe base per chiamare, inviare messaggi e navigare dall’estero, le promozioni dedicate, l’elenco degli operatori e i servizi disponibili;
• Trova punto assistenza: ricerca il punto assistenza Vodafone più vicino alla posizione attuale o ad un indirizzo specifico; 
• Widget: imposta il widget che ti permette di avere i tuoi contatori ancora più a portata di mano e di accedere velocemente alle fatture;
• Consensi e privacy:  fornisci i consensi presenti nelle impostazioni per ricevere offerte sempre più personalizzate in base alle tue esigenze.

Per suggerimenti o richieste di supporto dell’app, invia un’email a mybusiness.app@mail.vodafone.it

Where Are U is the app developed for calling the European Emergency Number 112 (where available), automatically sending your location information and all the other information you included in the app.
The European Emergency Number 112 was created to provide all European citizens with a single number for their emergencies: Ambulance, Firefighters, Police can be alerted by the same PSAP (Public Safety Answering Point) and the service automatically locates you, for a rapid and accurate response.

Where Are U allows you to:
- send your position to the 112 PSAP management software, allowing an accurate location, for a rapid response, when every second is important;
- store your personal data, including ICE (in case of emergency) numbers, that can be called for you by the 112 PSAP operator if necessary;
- enhanced interface for unimpaired sight citizens;
- "silent call" function to allow a call to 112 and warn of an emergency, even in situations when the caller is unable to speak;
- selection of the most appropriate type of emergency when calling 112;
- switching to the proper emergency number when travelling abroad (e.g. in the U.S.A.  the app will dial 911, instead of 112);
- guide and app tutorial available from the menu;
- chatthin with the 112 PSAP, very useful function for unimpaired hearing citizens and also crucial in every situation when speaking is not possibile.

To use the Where Are U services, you need to follow a free of charge registration process.

Vuoi controllare se un veicolo è in regola con l'assicurazione, sapere con quale compagnia è assicurato e controllarne la scadenza? 
Vuoi controllare se è stato pagato il bollo e quando scade? 
Vuoi verificare l'ultima revisione?
Vuoi verificare che non ci siano denunce pendenti per una targa o un numero di telaio? 
Con questa app puoi, e per qualsiasi veicolo (autoveicolo, motoveicolo, ciclomotore, autocarro): ti basterà solo inserire il numero di targa o di telaio.

Funzioni Base
  • Ricerca denunce per furto o smarrimento tramite numero di telaio;
  • Ricerca denunce per furto o smarrimento tramite numero di targa;
  • Ricerca dell'ultima revisione effettuata dal veicolo tramite numero di targa;
  • Ricerca dello stato di pagamento del bollo del veicolo tramite numero di targa;
  • Ricerca stato assicurativo del veicolo tramite numero di targa;
  • Verifica della data di scadenza dell'assicurazione del veicolo tramite numero di targa;
  • Cronologia delle ricerche effettuate;

Funzioni Premium
  • Cronologia illimitata delle ricerche effettuate;
  • Ordinamento della cronologia;
  • Rimozione di tutti i banner pubblicitari;

Per il controllo dell'assicurazione e del bollo sono attualmente supportate ricerche di:
  • Autoveicoli;
  • Motoveicoli;
  • Ciclomotori;
  • Autocarri;

Sono attualmente disponibili dettagli su:
  • Data di scadenza dell'assicurazione;
  • Data di scadenza del bollo;
  • Data di scadenza della revisione;

  • Compagnia Assicurativa;
  • Numero di polizza assicurativa
  • Classe universale, Decreto Bersani;
  • Numero di telaio;
  • Ultima voltura e ultima formalità (Attualmente disattivato dall'ACI)
  • Casa automobilistica;
  • Modello di veicolo;
  • Data di immatricolazione;
  • Tipologia di carburante;
  • Massima velocità;
  • Direttiva ambientale;
  • Cilindrata;
  • Potenza;
  • Uso;
  • Permesso di guida perneopatentati;
  • Veicolo ultratrentennale;

N.B. Le notizie relative ad auto, motoveicoli e targhe rubate, hanno valore puramente informativo e di nessun valore legale.

